import React from "react";
import db from "../config/fbConfig";

export const HomePage = async () => {
  const data = await db.collection("guides").get(all =>
    all.array.forEach(element => {
      console.log(element.data());
    })
  );
  console.log(data);
  return <h2>HomePage</h2>;
};
